			<rect x="457.16" y="77.37" class="st0" width="594.79" height="211.63"/>
			<text transform="matrix(1 0 0 1 457.165 96.4669)" class="st1 st2 st3">Los tamales son un platillo que se remonta a la </text>
			<text transform="matrix(1 0 0 1 972.785 96.4669)" class="st1 st4 st3">época </text>
			<text transform="matrix(1 0 0 1 457.165 122.8669)" class="st1 st4 st3">prehispánica de México</text>
			<text transform="matrix(1 0 0 1 736.095 122.8669)" class="st1 st2 st3">, se dice que eran un </text>
			<text transform="matrix(1 0 0 1 457.165 149.2669)" class="st1 st2 st3">alimento para las grandes fiestas y tambien como </text>
			<text transform="matrix(1 0 0 1 457.165 175.6669)" class="st1 st2 st3">ofrenda a los muertos. Este tamal era más firme y </text>
			<text transform="matrix(1 0 0 1 457.165 202.0669)" class="st1 st2 st3">apelmazado, elaborado con verduras como calabaza, </text>
			<text transform="matrix(1 0 0 1 457.165 228.4669)" class="st1 st2 st3">chile y maíz, productos tradicionales de nuestro país.</text>
		</g>
	</g>
